import "./App.css";
import Home from "./Components/home";
import About from "./Components/about";
import Contact from "./Components/contact";
import Projects from "./Components/projects";
import Layout from "./Components/layout";
import {React, useState} from "react";
import { BrowserRouter as Router, Route } from 'react-router-dom';
//import {BrowserRouter, Routes, Route} from "react-router-dom";
// import {BrowserRouter, Routes, Route} from "react-router-dom";
import { DropdownButton, ButtonGroup, Dropdown } from 'react-bootstrap';


const App = () => {
  const [key, setKey] = useState('home');
  return (

     <div>
      <>
        {['Info'].map(
          (variant) => (
            <DropdownButton
              as={ButtonGroup}
              key={variant}
              id={`dropdown-variants-${variant}`}
              variant={variant.toLowerCase()}
              title="Menu"
              activeKey={key}
              onSelect={(k) => setKey(k)}
            >
              <Dropdown.Item eventKey="home">
                <Router>
                    <Route path="/home" component={Home} />
                </Router>
              </Dropdown.Item>
              <Dropdown.Item eventKey="about">Another action</Dropdown.Item>
              <Dropdown.Item eventKey="projects">Active Item</Dropdown.Item>
              <Dropdown.Item eventKey="contact">Active Item</Dropdown.Item>
              <Dropdown.Divider />
              <Dropdown.Item eventKey="resume">Separated link</Dropdown.Item>
            </DropdownButton>
          ),
        )}
      </>

    </div>
  );
};

export default App;
